package beans;

public class CongViec {
	private String soCMND;
	private String ngayVaoCongTy;
	private String maNganh;
	private String tenCongViec;
	private String tenCongTy;
	private String diaChiCongty;
	private String thoiGianLamViec;
	
	public CongViec() {
		// TODO Auto-generated constructor stub
	}

	public CongViec(String soCMND, String ngayVaoCongTy, String maNganh, String tenCongViec, String tenCongTy,
			String diaChiCongty, String thoiGianLamViec) {
		super();
		this.soCMND = soCMND;
		this.ngayVaoCongTy = ngayVaoCongTy;
		this.maNganh = maNganh;
		this.tenCongViec = tenCongViec;
		this.tenCongTy = tenCongTy;
		this.diaChiCongty = diaChiCongty;
		this.thoiGianLamViec = thoiGianLamViec;
	}

	/**
	 * @return the soCMND
	 */
	public String getSoCMND() {
		return soCMND;
	}

	/**
	 * @param soCMND the soCMND to set
	 */
	public void setSoCMND(String soCMND) {
		this.soCMND = soCMND;
	}

	/**
	 * @return the ngayVaoCongTy
	 */
	public String getNgayVaoCongTy() {
		return ngayVaoCongTy;
	}

	/**
	 * @param ngayVaoCongTy the ngayVaoCongTy to set
	 */
	public void setNgayVaoCongTy(String ngayVaoCongTy) {
		this.ngayVaoCongTy = ngayVaoCongTy;
	}

	/**
	 * @return the maNganh
	 */
	public String getMaNganh() {
		return maNganh;
	}

	/**
	 * @param maNganh the maNganh to set
	 */
	public void setMaNganh(String maNganh) {
		this.maNganh = maNganh;
	}

	/**
	 * @return the tenCongViec
	 */
	public String getTenCongViec() {
		return tenCongViec;
	}

	/**
	 * @param tenCongViec the tenCongViec to set
	 */
	public void setTenCongViec(String tenCongViec) {
		this.tenCongViec = tenCongViec;
	}

	/**
	 * @return the tenCongTy
	 */
	public String getTenCongTy() {
		return tenCongTy;
	}

	/**
	 * @param tenCongTy the tenCongTy to set
	 */
	public void setTenCongTy(String tenCongTy) {
		this.tenCongTy = tenCongTy;
	}

	/**
	 * @return the diaChiCongty
	 */
	public String getDiaChiCongty() {
		return diaChiCongty;
	}

	/**
	 * @param diaChiCongty the diaChiCongty to set
	 */
	public void setDiaChiCongty(String diaChiCongty) {
		this.diaChiCongty = diaChiCongty;
	}

	/**
	 * @return the thoiGianLamViec
	 */
	public String getThoiGianLamViec() {
		return thoiGianLamViec;
	}

	/**
	 * @param thoiGianLamViec the thoiGianLamViec to set
	 */
	public void setThoiGianLamViec(String thoiGianLamViec) {
		this.thoiGianLamViec = thoiGianLamViec;
	}
	
	
}
